import React from "react";
import "rc-time-picker/assets/index.css";
import TimePicker from "rc-time-picker";

class Timepicker extends React.Component {
  state = {
    startValue: this.props.defaultStart,
    endValue: this.props.defaultEnd
  };

  handleStartValueChange = startValue => {
    this.setState({ startValue });
    console.log(startValue.format("h:mm A"));
  };

  handleEndValueChange = endValue => {
    this.setState({ endValue });
    console.log(endValue.format("h:mm A"));
  };

  render() {
    const { startValue, endValue } = this.state;
    return (
      <div>
        <h3> Start: </h3>
        <TimePicker
          id="start"
          showSecond={false}
          defaultValue={startValue}
          onChange={this.handleStartValueChange}
          format={"h:mm A"}
          minuteStep={15}
          use12Hours
          className="xxx"
        />
        <h3> End: </h3>
        <TimePicker
          id="end"
          showSecond={false}
          defaultValue={endValue}
          onChange={this.handleEndValueChange}
          format={"h:mm A"}
          minuteStep={15}
          use12Hours
          className="xxx"
        />
      </div>
    );
  }
}

export default Timepicker;
